import React from "react";

function Home() {
  return (
    <div className="home">
      {/* card */}
      <div className="card">
        {/* card-header */}
        <div className="card-header">
          {/* card-pic */}
          <div className="card-pic">
            <img
              src="https://images.unsplash.com/photo-1472099645785-5658abf4ff4e?q=80&w=2070&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D"
              alt=""
            />
          </div>
          <h5>Ramesh</h5>
          {/* card-image */}
          <div className="card-image">
            <img
              src="https://images.unsplash.com/photo-1703270102010-0003360a821f?q=80&w=1854&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D"
              alt=""
            />
          </div>
          {/* card-content */}
          <div className="card-content">
            <span class="material-symbols-outlined">favorite</span>
            <p>1 Like</p>
            <p>This is </p>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
